window.bookSummaryJSON = "<p>A lesbian *erotic novel featuring the Seven Deadly Sins. This sequel follows on from Wrath, War, and the Woe Trumpets.</p> <p>The arrival of four fallen angels at Edwin’s Castle heralds the final stage of the prophesied biblical apocalypse. The devastation left behind by the Woe Trumpets is only the beginning of the trials and tribulations to be faced by the Horsewomen in this explosive finale. Whilst War steps up to prepare for the biggest battle of her life, Death has her own demons to contend with, and there is far more to Famine than meets the eye.</p> <p>Bonds deepen as old and new relationships are forged and tested, and previously unknown powers are unleashed when it truly matters the most. Can the evil of the world prevail against God’s trusted archangels … for the greater good?</p> <p>*18+, sexually explicit content, some BDSM, storyline contains violence.</p>"; 
